import React from "react";
import '../Common/style.css';
import AboutImg from '../Assestes/about.png'
function About() {
  return (
    <>
      <div className="about">
        <div className="child">
          <img src={AboutImg} alt="AboutImg" />
        </div>
        <div className="child"></div>
      </div>
    </>
  );
}

export default About;
